      "id" : "7ac12f2e-b8e3-4473-b2c0-4f33c15159cc",
      "uri" : "https://fellesdatakatalog.brreg.no/api/concepts/7ac12f2e-b8e3-4473-b2c0-4f33c15159cc",
      "identifier" : "http://begrepskatalogen/begrep/108097c3-25fc-11e9-85c0-005056821322",
      "application" : [ ],
      "definition" : {
        "text" : {
          "nb" : "klassifiseringsvariabel som forteller om en gitt vegadresse i riket eller ev. annen fast eiendom uten vegadresse i riket ligger i et tettsted og ev. graderer hvor stort det aktuelle tettstedet er"
        },
        "remark" : {
          "nb" : "Statistisk sentralbyrå deklarerer kodene og hva som skal regnes som tettsted:\n0 - spredtbebygd område\n2 - tettsted med 200 - 499 innbyggere\n3 - tettsted med 500 - 999 innbyggere\n4 - tettsted med 1 000 - 1 999 innbyggere\n5 - tettsted med 2 000 - 19 999 innbyggere\n6 - tettsted med 20 000 - 99 999 innbyggere\n7 - tettsted med over 99 999 innbyggere\n\nSkatteetaten fastslår boligeiendommers tetthetskode ut fra ev. veiadresse.\n\nEn regner en hussamling som et tettsted dersom det bor minst 200 personer der og avstanden mellom husene skal normalt ikke overstiger 50 meter. Det er tillatt med et skjønnsmessig avvik utover 50 meter mellom husene i områder som ikke skal eller kan bebygges. Dette kan f.eks. være parker, idrettsanlegg, industriområder eller naturlige hindringer som elver eller dyrkbare områder. Husklynger som naturlig hører med til tettstedet tas med inntil en avstand på 400 meter fra tettstedskjernen. De inngår i tettstedet som en satellitt til selve tettstedskjernen.               \n\nDet generelle kravet om maksimal avstand mellom bygninger i tettsteder økes i fra 50 meter og opp til 200 meter for følgende bygningstyper: boligblokk, industribygg o.l., varehus, kontor, lager o.l., offentlig bygg, undervisning, sykehus og lignende\n\nTettsteder er geografiske områder som har en dynamisk avgrensing, og antall tettsteder og deres yttergrenser vil endre seg over tid avhengig av byggeaktivitet og befolkningsutvikling. Tettstedene avgrenses uavhengig av de administrative grensene.\n\nTetthetskoden brukes sammen med andre opplysninger til å fastsette boligverdi for boliger i Fastlands-Norge."
        },
        "sources" : [ ]
      },
